import React from 'react';
function Conteudo() {
  return (
    <div className="page">
      <h1>Conteúdo de Plantio</h1>
      <ul>
        <li>Como começar a plantar</li>
        <li>Hábitos de cuidados</li>
        <li>Calendário da horta</li>
        <li>Passos para horta dentro de casa</li>
        <li>Colha no momento certo</li>
        <li>Técnicas de plantio</li>
      </ul>
    </div>
  );
}
export default Conteudo;
